resources.description:
Get collection attributes

**URL** : `/collection-attributes`

**Method** : `GET`

**Auth required** : NO

**Permissions required** : None

## Success Response

**Condition** : If everything is OK

**Code** : `200`

**Content**

```json
{
	"status": 1,
	"data": {
		"results": {
			"kind": {
				"Meerkats": 50,
				"Normies": 1499,
				"Skellies": 97,
				"Zombies": 139
			},
			"seed": {
				...
			}
		}
	}
}
```
